INSERT INTO `tabelalanche2` (`id`,`nome`,`descricao`,`imagem`,`imagens`) VALUES (1,'CheeseBurguer','Um clássico americano! O Cheeseburger é feito com um hambúrguer suculento de carne bovina, queijo derretido, alface fresca, tomate e cebola roxa, tudo isso envolto em um pão de hambúrguer macio.','','');
INSERT INTO `tabelalanche2` (`id`,`nome`,`descricao`,`imagem`) VALUES (2,'Chicken','Uma opção saudável e deliciosa! O Frango Grelhado é preparado com peito de frango marinado, grelhado até ficar dourado e suculento. Servido com alface, tomate, maionese e pão integral.','');
INSERT INTO `tabelalanche2` (`id`,`nome`,`descricao`,`imagem`) VALUES (3,'Bauru','Uma combinação clássica de rosbife fatiado, queijo derretido, tomate fresco e pepino crocante, tudo envolto em pão francês crocante. Uma explosão de sabores brasileiros em cada mordida! Adicione bacon crocante para uma experiência ainda mais irresistível.','');
INSERT INTO `tabelalanche2` (`id`,`nome`,`descricao`,`imagem`) VALUES (4,'X-Calabresa','Satisfaça seus desejos por sabor e picância com o nosso X-Calabresa Apimentado! Preparado com fatias generosas de linguiça calabresa grelhada, combinadas com queijo derretido e um toque especial de pimenta, tudo dentro de um pão macio e fresco. Uma explosão de sabores que vai deixar seu paladar pedindo por mais. Experimente o sabor autêntico do Brasil em cada mordida com o nosso X-Calabresa Apimentado!','');
INSERT INTO `tabelalanche2` (`id`,`nome`,`descricao`,`imagem`) VALUES (5,'X-Bacon Supremo','Prepare-se para uma experiência incrível de sabor com o nosso X-Bacon Supremo! Delicie-se com camadas suculentas de bacon crocante, combinadas com queijo derretido e um hambúrguer suculento, tudo envolto em um pão macio e fresco. Cada mordida é uma explosão de sabores intensos que vai conquistar o seu paladar. Experimente o sabor irresistível do nosso X-Bacon Supremo e eleve seu amor por sanduíches a um novo patamar!','');
INSERT INTO `tabelalanche2` (`id`,`nome`,`descricao`,`imagem`) VALUES (6,'X-Tudo','Prepare-se para uma experiência épica de sabor com o nosso X-Tudo Mega Sabor! Este sanduíche reúne o melhor de todos os mundos culinários em uma só mordida. Desfrute de camadas generosas de hambúrguer suculento, bacon crocante, queijo derretido, ovo frito, alface fresca, tomate e uma pitada especial de maionese, tudo isso abraçado por um pão macio e fresquinho. Cada mordida é uma jornada gastronômica emocionante, proporcionando uma explosão de sabores que vai deixar seu paladar extasiado. Renda-se ao sabor inigualável do nosso X-Tudo Mega Sabor e faça uma viagem culinária que você não vai esquecer tão cedo!','');
INSERT INTO `tabelalanche2` (`id`,`nome`,`descricao`,`imagem`) VALUES (7,'X-TudoDuplo','Desfrute de uma explosão de sabores com o nosso X-Tudo Duplo! Dois hambúrgueres suculentos, bacon crocante, queijo derretido, ovo frito, alface, tomate e maionese, tudo entre fatias de pão fresco. Uma experiência de sabor dupla e irresistível em cada mordida!','');
INSERT INTO `tabelalanche2` (`id`,`nome`,`descricao`,`imagem`) VALUES (8,'X-Cheedar','Experimente o sabor rico e marcante do nosso X-Cheedar! Este delicioso sanduíche apresenta um hambúrguer suculento, generosas fatias de queijo cheddar derretido, bacon crocante e uma camada de alface fresca, tudo entre duas fatias de pão macio. Cada mordida é uma explosão de sabores que combina a suavidade do queijo com o sabor robusto do bacon e do hambúrguer. Renda-se ao irresistível X-Cheedar e descubra o verdadeiro prazer do queijo derretido em cada pedaço!','');
INSERT INTO `tabelalanche2` (`id`,`nome`,`descricao`,`imagem`) VALUES (9,'X-Vegano','Descubra uma nova dimensão de sabor com o nosso X-Vegano! Criado para os amantes da culinária consciente, este sanduíche apresenta um hambúrguer vegano suculento feito de ingredientes naturais e nutritivos, acompanhado por queijo vegano derretido, tomate fresco, alface crocante e um toque especial de maionese vegana, tudo abraçado por um pão macio e fresco. Cada mordida é uma celebração de sabores frescos e sustentáveis, proporcionando uma experiência gastronômica que agrada tanto ao paladar quanto à consciência. Satisfaça seus desejos de forma ética e deliciosa com o nosso X-Vegano!','');
INSERT INTO `tabelalanche2` (`id`,`nome`,`descricao`,`imagem`) VALUES (10,'X-Salada','Desfrute de um clássico saboroso com o nosso X-Salada! Preparado com um suculento hambúrguer, queijo derretido, alface fresca e fatias de tomate, tudo entre duas fatias de pão macio. Esta combinação simples, porém irresistível, oferece uma explosão de frescor e sabor em cada mordida. Saboreie a autenticidade e a simplicidade do X-Salada, uma escolha que nunca decepciona.','');
